// Metadata for HomePage.js images and their positions
// Update or expand as needed for new images or layout changes

import marrymeImg from '../images/marryme.png';
import womengrillImg from '../images/womengrills.png';
import boardImg from '../images/board.png';
import jadePortraitImg from '../images/jade portrait 1.png';
import discoBallImg from '../images/disco ball 1.png';
import gingerbreadHouseImg from '../images/gingerbread house 1.png';

export const homePageImageMeta = [
// Top row images
 {
    name: 'board',
    src: boardImg,
    alt: 'message board',
    position: { section: 'top', grid: { row: 1, col: 1 } },
  },
  {
    name: 'marryme',
    src: marrymeImg,
    alt: 'flamingo 4',
    position: { section: 'top', grid: { row: 1, col: 1 } },
    width: 100,
    height: 59
  },
  {
    name: 'womengrill',
    src: womengrillImg,
    alt: 'flamingo 4',
    position: { section: 'top', grid: { row: 1, col: 2 } },
    width: 100,
    height: 93
  },
  {
    name: 'jadePortrait',
    src: jadePortraitImg,
    alt: 'world 5',
    position: { section: 'top', grid: { row: 1, col: 4 } },
    motion: true,
    transitionDuration: 2
  },
  {
    name: 'discoBall',
    src: discoBallImg,
    alt: 'world 5',
    position: { section: 'middle', grid: { row: 2, col: 1 } },
    motion: true,
    transitionDuration: 3
  },
  {
    name: 'gingerbreadHouse',
    src: gingerbreadHouseImg,
    alt: 'flamingo 4',
    position: { section: 'middle', grid: { row: 2, col: 3 } }
  }
];
